import{_ as t,c as o,a2 as r,o as n}from"./chunks/framework.Dz7_3PEu.js";const h=JSON.parse('{"title":"只言片语","description":"","frontmatter":{"title":"只言片语","prev":false,"next":false},"headers":[],"relativePath":"blog/cross/index.md","filePath":"blog/cross/index.md"}'),s={name:"blog/cross/index.md"};function g(a,p,e,i,l,c){return n(),o("div",null,p[0]||(p[0]=[r('<h1 id="只言片语" tabindex="-1">只言片语 <a class="header-anchor" href="#只言片语" aria-label="Permalink to &quot;只言片语&quot;">​</a></h1><h2 id="_2025" tabindex="-1">2025 <a class="header-anchor" href="#_2025" aria-label="Permalink to &quot;2025&quot;">​</a></h2><p><strong>2025-01-12 06:05:00</strong></p><p>我也希望自己被鼓励和夸奖。</p><h2 id="_2024" tabindex="-1">2024 <a class="header-anchor" href="#_2024" aria-label="Permalink to &quot;2024&quot;">​</a></h2><p><strong>2024-12-13 14:51:34</strong></p><p>不能细想，不然全是伤心。</p><p><strong>2024-12-11 01:25:45</strong></p><p>感觉其实Typecho的默认主题也完全够用。</p><p><strong>2024-12-06 02:21:01</strong></p><p>为一个没人看的个人网站，一年花费小一千，真的值得吗？</p><p><strong>2024-11-29 20:25:30</strong></p><p>我偶尔会觉得自己是个天才。</p><p><strong>2024-11-26 13:38:09</strong></p><p>感觉钓鱼比打游戏好玩多了。。。</p><p><strong>2024-11-25 01:47:52</strong></p><p>现在亚刻给我的感觉就是鸡肋。</p><p><strong>2024-11-18 14:50:55</strong></p><p>加布真好看吧，起码目前为止是这样，这几年的骑士剧属实让我不敢半场开香槟。</p><p><strong>2024-11-17 08:54:46</strong></p><p>好想钓鱼啊啊啊啊啊啊啊啊啊</p><p>（坏了，染上钓鱼了</p><p><strong>2024-11-17 00:53:25</strong></p><p>合理怀疑我的网站访问慢是我的NGINX配置问题。</p><p><strong>2024-11-16 13:59:32</strong></p><p>试试Typecho的朋友圈主题</p><p><strong>2024-10-12 22:20:59</strong></p><p>试试vercel。</p><p><strong>2024-10-11 19:29:54</strong></p><p>不管是对文艺作品也好，对游戏也好，对美食也好，我都会有一个较为主观的评价。</p><p>这个评价很大程度上依赖于我自己的喜好和口味。</p><p>我尚未达到那种，阅尽千帆后的，能对一个事物能做出足够客观的评价，的境界。</p><p>依据我现在的评价标准来看：在美食节目里大谈文化纯属耍流氓，我只想知道它口味如何，好不好吃。（图穷匕见）</p><p><strong>2024-10-07 06:16:19</strong></p><p>己所不欲，勿施于人。</p><p>己所欲者，勿强于人。</p><p><strong>2024-10-05 12:16:34</strong></p><p>摘抄：“感受不到的爱就不是爱。”</p><p>另一个摘抄：“</p><p>有人说：‘我这样破碎的人，爱我的人，要一片片捡起来爱我，实在是太辛苦了。’</p><p>有人回复：‘爱你的人会美滋滋地边捡边喃喃道：这片是我的，这片也是我的。’ ”</p><p><strong>2024-10-05 10:02:06</strong></p><p>我好像有个挺奇怪的习惯。</p><p>比如，我在看完各种刷到的小片段之后，对《葬送的芙莉莲》还挺感兴趣的。</p><p>按理来说我这时候应该去把这个番看一遍。但是因为我知道这个番很短，所以我又不愿意去看了。</p><p>我怕很快看完了，所以不去看。</p><p>类似于有些人会把喜欢的菜最后吃掉的心情吧。</p><p>但如果不去看，那这个番对我而言反而更像不存在一样。我觉得番对于一个个人的最直接的价值就是被看。</p><p>总之正常人都是：刷到、喜欢、追番，这个流程吧。</p><p>还挺奇妙的。</p><p><strong>2024-10-03 10:22:51</strong></p><p>累了，毁灭吧，赶紧的。</p><p>（其实只是对博客访问速度不满意，又找不到符合我需求和现况的解决方法。）</p><p><strong>2024-09-23 22:44:00</strong></p><p>人们喜欢傲娇，喜欢的是娇而不是傲，喜欢呆萌，喜欢的是萌而不是呆。</p><p><strong>2024-08-12 04:19:37</strong></p><p>总是躲到这又躲到那，躲来躲去，最后躲无可躲。</p><p><strong>2024-08-10 22:14:30</strong></p><p>有很多话想说，却不知从何说起。</p><p><strong>2024-07-03 04:59:50</strong></p><p>睡不着去翻书看，我把书翻烂了也没看出李清照的《如梦令·昨夜雨疏风骤》是写男欢女爱和宅斗的。</p><p><strong>2024-05-30 01:41:17</strong></p><p>道路是曲折的，前途是光明的。</p><p><strong>2024-05-30 00:00:19</strong></p><p>控制情绪。</p><p><strong>2024-05-06 02:40:05</strong></p><p>想会得多，那就得去学得多。</p><p><strong>2024-04-11 02:29:08</strong></p><p>不要变得麻木。</p><p><strong>2024-03-27 19:50:35</strong></p><p>把博客里所有关于计算机的文章整理成一个文档式的网站了，不得不说，好用多了。</p><h2 id="_2023" tabindex="-1">2023 <a class="header-anchor" href="#_2023" aria-label="Permalink to &quot;2023&quot;">​</a></h2><p><strong>2023-09-25 20:17:58</strong></p><p>每次看到摩尔定律还是挺感慨的。</p><p><strong>2023-09-25 19:40:39</strong></p><p>忽然发现前面发动态是19号，现在已经是25号了，时间过的也太快了吧。</p><p><strong>2023-09-25 19:32:26</strong></p><p>找了一圈mathjax渲染公式显示的bug，然后发现是改了博客字体的原因，心累。</p><p><strong>2023-09-19 22:34:01</strong></p><p>从github转到gitlab，体验真的好了太多。</p><p><strong>2023-09-19 16:10:37</strong></p><p>我从未见过如CSDN这般厚颜无耻且没用的网站。</p><p><strong>2023-09-19 15:19:13</strong></p><p>这哪是在恢复博客备份，这分明是在练习使用git。</p><p><strong>2023-09-18 07:15:38</strong></p><p>只有当我专注于某件事时，我才能感觉到自己活着。</p><p><strong>2023-09-17 20:59:02</strong></p><p>他人即地狱。</p><p><strong>2023-09-14 06:46:46</strong></p><p>昨晚又只睡了一个小时，感觉迟早猝死（最好早点）。另外我大概是不会相信爱了，不是爱情，是爱。如果有一天我竟然又相信爱了，希望这条动态能把我打醒。</p><p><strong>2023-09-13 19:15:12</strong></p><p>兜兜转转又用回了Hexo，感觉我选择搭建博客的方案的心路历程都能写一篇博客出来了。</p><p><strong>2023-09-11 07:09:51</strong></p><p>生活不过是一场慢性死亡。而我是那个等死的傻逼。</p><p><strong>2023-07-19 09:48:21</strong></p><p>用hugo重建了博客站点，虽然还没整完，差了很多，但是因为实在忍不了以前的站点访问速度了，所以决定先把这个半成品挂上去再说。</p><p><strong>2023-04-20 05:31:27</strong></p><p>换了新CPU让我用电脑处理各种乱七八糟的东西没卡顿大概是我最近仅有的顺心的事情。</p><p><strong>2023-04-09 23:56:17</strong></p><p>我终于意识到我心态是真不行，这一天天的焦虑的睡不着觉。</p><p><strong>2023-04-08 21:58:53</strong></p><p>每次看到别人的博客就会觉得很好看，我也想整成那样的。是的，我又开始嫌弃现在的博客页面了。</p>',102)]))}const u=t(s,[["render",g]]);export{h as __pageData,u as default};
